import React from "react";

function Movie({movie}){

  return (
    <div className="movie"> 
      <img src={movie.poster} alt={movie.title} />
      <div>
        <p>{movie.title}</p>
        <p>{movie.grade}</p>
      </div>
    </div>
  );
}

export default Movie;
